import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Educational Institution Finance Management</h1>
        <p>A comprehensive solution for managing your institution's finances.</p>
      </header>
    </div>
  );
}

export default App;
